INSERT INTO diagnosis_results VALUES(1,7,'Bruit étrange du moteur au démarrage','No description available','high',85,'[{"title":"Probl\u00e8me de d\u00e9marreur","description":"Le bruit pourrait \u00eatre caus\u00e9 par un d\u00e9marreur d\u00e9fectueux ou us\u00e9, qui a du mal \u00e0 engager le moteur correctement.","probability":75}]','[{"title":"Inspection du d\u00e9marreur","description":"Faire inspecter et tester le d\u00e9marreur par un technicien qualifi\u00e9 pour v\u00e9rifier son bon fonctionnement et remplacer si n\u00e9cessaire.","urgency":"Immediate"}]','[{"service":"Remplacement du d\u00e9marreur","min":300,"max":600,"currency":"USD","formatted_min":"USD 300","formatted_max":"USD 600"}]','["Il est conseill\u00e9 de v\u00e9rifier \u00e9galement l''\u00e9tat de la batterie et du syst\u00e8me de charge, car un probl\u00e8me de tension peut \u00e9galement affecter le d\u00e9marreur."]','["Probl\u00e8mes de batterie","D\u00e9faillance du syst\u00e8me de charge"]',1,'1.0','2025-09-29 20:32:24','2025-09-29 20:32:24','2025-09-29 20:32:24');
INSERT INTO diagnosis_results VALUES(2,8,'Zhurmë e çuditshme e motorit gjatë ndezjes','No description available','medium',85,'[{"title":"Probleme me rripin e alternatorit","description":"Rripi i alternatorit mund t\u00eb jet\u00eb i lir\u00eb ose i konsumuar, duke shkaktuar zhurm\u00eb gjat\u00eb ndezjes s\u00eb motorit.","probability":75}]','[{"title":"Kontrolli i rripit t\u00eb alternatorit","description":"Kontrolloni dhe, n\u00ebse \u00ebsht\u00eb e nevojshme, z\u00ebvend\u00ebsoni rripin e alternatorit p\u00ebr t\u00eb shmangur zhurm\u00ebn dhe problemet e tjera t\u00eb mundshme.","urgency":"Brenda 1 jav\u00ebs"}]','[{"service":"Z\u00ebvend\u00ebsimi i rripit t\u00eb alternatorit","min":100,"max":300,"currency":"USD","formatted_min":"USD 100","formatted_max":"USD 300"}]','["Kontrolloni gjithashtu tensionin e rripit dhe komponent\u00ebt e tjer\u00eb t\u00eb sistemit t\u00eb alternatorit p\u00ebr t\u00eb siguruar funksionim t\u00eb duhur."]','["Probleme me alternatorin ose baterin\u00eb"]',0,'1.0','2025-09-29 20:32:51','2025-09-29 20:32:51','2025-09-29 20:32:51');
INSERT INTO diagnosis_results VALUES(3,9,'Probleme me Sistemin e Karburantit','No description available','medium',85,'[{"title":"Filtri i Karburantit i Bllokuar","description":"Filtri i karburantit mund t\u00eb jet\u00eb bllokuar p\u00ebr shkak t\u00eb papast\u00ebrtive ose mbetjeve, duke kufizuar rrjedh\u00ebn e karburantit dhe duke shkaktuar performanc\u00eb t\u00eb dob\u00ebt t\u00eb motorit.","probability":75}]','[{"title":"Nd\u00ebrrimi i Filtrit t\u00eb Karburantit","description":"Kontrolloni dhe z\u00ebvend\u00ebsoni filtrin e karburantit p\u00ebr t\u00eb siguruar rrjedh\u00eb t\u00eb lir\u00eb t\u00eb karburantit dhe p\u00ebr t\u00eb p\u00ebrmir\u00ebsuar performanc\u00ebn e motorit.","urgency":"Brenda 1 jav\u00ebs"}]','[{"service":"Z\u00ebvend\u00ebsimi i Filtrit t\u00eb Karburantit","min":100,"max":200,"currency":"USD","formatted_min":"USD 100","formatted_max":"USD 200"}]','["Kontrolloni gjithashtu injektor\u00ebt e karburantit p\u00ebr ndonj\u00eb bllokim ose d\u00ebmtim, pasi mund t\u00eb ndikojn\u00eb n\u00eb performanc\u00ebn e motorit."]','["Probleme me injektor\u00ebt e karburantit","Probleme me pomp\u00ebn e karburantit"]',0,'1.0','2025-09-29 20:35:11','2025-09-29 20:35:11','2025-09-29 20:35:11');
INSERT INTO diagnosis_results VALUES(4,10,'Problème de performance moteur','No description available','high',85,'[{"title":"Encrassement du filtre \u00e0 particules (FAP)","description":"Le filtre \u00e0 particules peut \u00eatre obstru\u00e9, ce qui entra\u00eene une restriction du flux d''\u00e9chappement et une perte de puissance.","probability":75},{"title":"Injecteurs de carburant d\u00e9fectueux","description":"Les injecteurs peuvent \u00eatre encrass\u00e9s ou d\u00e9fectueux, ce qui affecte la pulv\u00e9risation du carburant et la combustion.","probability":65}]','[{"title":"Nettoyage ou remplacement du FAP","description":"Faire v\u00e9rifier et nettoyer le filtre \u00e0 particules. Si n\u00e9cessaire, le remplacer pour restaurer la performance du moteur.","urgency":"Immediate"},{"title":"Inspection et nettoyage des injecteurs","description":"Proc\u00e9der \u00e0 une inspection des injecteurs et les nettoyer pour assurer une bonne pulv\u00e9risation du carburant.","urgency":"Within 1 week"}]','[{"service":"Nettoyage du FAP","min":150,"max":400,"currency":"USD","formatted_min":"USD 150","formatted_max":"USD 400"},{"service":"Nettoyage des injecteurs","min":100,"max":300,"currency":"USD","formatted_min":"USD 100","formatted_max":"USD 300"}]','["Assurez-vous que le v\u00e9hicule a subi un entretien r\u00e9gulier, notamment le remplacement des filtres \u00e0 air et \u00e0 carburant.","V\u00e9rifiez \u00e9galement le syst\u00e8me de recirculation des gaz d''\u00e9chappement (EGR) qui peut \u00eatre encrass\u00e9."]','["Probl\u00e8mes de turbo","D\u00e9faillance de la vanne EGR"]',1,'1.0','2025-09-30 18:04:08','2025-09-30 18:04:08','2025-09-30 18:04:08');
INSERT INTO diagnosis_results VALUES(5,11,'Problème de performance moteur','No description available','high',85,'[{"title":"Filtre \u00e0 carburant obstru\u00e9","description":"Un filtre \u00e0 carburant obstru\u00e9 peut r\u00e9duire le flux de carburant vers le moteur, entra\u00eenant une perte de puissance.","probability":75},{"title":"Probl\u00e8me avec le syst\u00e8me EGR","description":"Le syst\u00e8me de recirculation des gaz d''\u00e9chappement (EGR) peut \u00eatre encrass\u00e9, ce qui affecte la performance du moteur.","probability":60}]','[{"title":"Remplacement du filtre \u00e0 carburant","description":"Remplacer le filtre \u00e0 carburant pour assurer un flux de carburant ad\u00e9quat vers le moteur.","urgency":"Immediate"},{"title":"Nettoyage du syst\u00e8me EGR","description":"Nettoyer le syst\u00e8me EGR pour am\u00e9liorer la recirculation des gaz et la performance du moteur.","urgency":"Within 1 week"}]','[{"service":"Remplacement du filtre \u00e0 carburant","min":100,"max":150,"currency":"USD","formatted_min":"USD 100","formatted_max":"USD 150"},{"service":"Nettoyage du syst\u00e8me EGR","min":150,"max":300,"currency":"USD","formatted_min":"USD 150","formatted_max":"USD 300"}]','["V\u00e9rifiez \u00e9galement l''\u00e9tat des injecteurs de carburant, car une usure excessive peut \u00e9galement causer des probl\u00e8mes similaires.","Assurez-vous que le syst\u00e8me de gestion du moteur ne pr\u00e9sente pas de codes d''erreur stock\u00e9s qui pourraient indiquer d''autres probl\u00e8mes sous-jacents."]','["Probl\u00e8mes potentiels avec le turbo","Usure des injecteurs de carburant"]',1,'1.0','2025-09-30 21:17:34','2025-09-30 21:17:34','2025-09-30 21:17:34');
